import React from "react";
import styled from "styled-components";
import {  } from "module";

const Card = styled.div`
  height: 100%;
  overflow-y: scroll;
  background: ${({ theme }) => theme.bg}
  padding: 30px 30px;
  padding-bottom: 50px;
  display: flex;
  flex-direction: column;
  align-items: center;
  gap: 20px;
  @media (max-width: 768px) {
    padding: 6px 10px;
  }
`;

const ImageCard = () => {
  return <Card>ImageCard</Card>;
};

export default ImageCard;
